import React, { Component } from 'react';

class Header3figure extends Component {
  render() {
    return (
      <h3 className="figure-header">
        <span>FIGURE 1.</span> Russia Slowdown in inflation supports key rate
        cuts
      </h3>
    );
  }
}

export default Header3figure;
